package main

import (
	"encoding/base64"
	"fmt"
	"os"
)

func main() {
	fmt.Println("start----------------")
	// fileToBase64()
	base64ToFile()
	fmt.Println("end---------------")
}

// 从test.txt中读取base64字符串，解码，然后生成文件
func base64ToFile() {
	data := ""
	decodeData, err := base64.StdEncoding.DecodeString(string(data))
	if err != nil {
		panic(err)
	}
	filePath := "/data/miluwu/go-test/test/programmer/file/babylon2.mp4"

	f, err := os.OpenFile(filePath, os.O_RDWR|os.O_CREATE, os.ModePerm)
	if err != nil {
		panic(err)
	}
	defer f.Close()
	f.Write(decodeData)
}
